    'about.AboutText1': 'OLX \u0C05\u0C28\u0C47\u0C26\u0C3F \u0C05\u0C2D\u0C3F\u0C35\u0C43\u0C26\u0C4D\u0C27\u0C3F \u0C1A\u0C46\u0C02\u0C26\u0C41\u0C24\u0C41\u0C28\u0C4D\u0C28 \u0C2E\u0C3E\u0C30\u0C4D\u0C15\u0C46\u0C1F\u0C4D\u0C32\u0C2A\u0C48 \u0C26\u0C43\u0C37\u0C4D\u0C1F\u0C3F \u0C15\u0C47\u0C02\u0C26\u0C4D\u0C30\u0C40 \u0C15\u0C30\u0C3F\u0C02\u0C1A\u0C3F\u0C28 \u0C2A\u0C4D\u0C30\u0C2A\u0C02\u0C1A\u0C02\u0C32\u0C4B \u0C05\u0C17\u0C4D\u0C30\u0C38\u0C4D\u0C25\u0C3E\u0C28\u0C02\u0C32\u0C4B \u0C09\u0C28\u0C4D\u0C28 \u0C2E\u0C4A\u0C2C\u0C48\u0C32\u0C4D \u0C07\u0C02\u0C15\u0C3E \u0C05\u0C28\u0C4D \u0C32\u0C48\u0C35\u0C4D \u0C15\u0C4D\u0C32\u0C3E\u0C38\u0C3F\u0C2B\u0C48\u0C21\u0C4D\u0C38\u0C4D \u0C35\u0C47\u0C26\u0C3F\u0C15.',
    'about.AboutText2': 'OLX \u0C05\u0C28\u0C47\u0C26\u0C3F \u0C35\u0C3F\u0C36\u0C4D\u0C35\u0C35\u0C4D\u0C2F\u0C3E\u0C2A\u0C4D\u0C24\u0C02\u0C17\u0C3E \u0C28\u0C3F\u0C30\u0C4D\u0C35\u0C39\u0C3F\u0C02\u0C1A\u0C2C\u0C21\u0C41\u0C24\u0C42 40\u0C15\u0C3F\u0C2A\u0C48\u0C17\u0C3E \u0C26\u0C47\u0C36\u0C3E\u0C32\u0C32\u0C4B \u0C09\u0C02\u0C26\u0C3F.',
    'about.about_Body': '<p>OLX \u0C07\u0C26\u0C3F \u0C06\u0C28\u0C4D \u0C32\u0C48\u0C28\u0C4D \u0C15\u0C4D\u0C32\u0C3E\u0C38\u0C3F\u0C2B\u0C48\u0C21\u0C4D\u0C38\u0C4D \u0C32\u0C4B \u0C24\u0C30\u0C4D\u0C35\u0C3E\u0C24\u0C3F \u0C24\u0C30\u0C02.<br /><br />\u0C2E\u0C40\u0C30\u0C41 \u0C09\u0C28\u0C4D\u0C28 \u0C2A\u0C4D\u0C30\u0C3E\u0C02\u0C24\u0C3E\u0C28\u0C3F\u0C15\u0C3F \u0C26\u0C17\u0C4D\u0C17\u0C30\u0C32\u0C4B \u0C09\u0C28\u0C4D\u0C28\u0C35\u0C3E\u0C30\u0C3F\u0C28\u0C3F \u0C15\u0C32\u0C35\u0C1F\u0C02\u0C32\u0C4B, \u0C35\u0C38\u0C4D\u0C24\u0C41\u0C35\u0C41\u0C32\u0C28\u0C41 \u0C05\u0C2E\u0C4D\u0C2E\u0C1F\u0C02\u0C32\u0C4B, \u0C15\u0C4A\u0C28\u0C1F\u0C02\u0C32\u0C4B, \u0C35\u0C30\u0C4D\u0C24\u0C15\u0C02\u0C32\u0C4B, \u0C1A\u0C30\u0C4D\u0C1A\u0C3F\u0C02\u0C1A\u0C21\u0C02\u0C32\u0C4B, \u0C28\u0C3F\u0C30\u0C4D\u0C35\u0C39\u0C3F\u0C02\u0C1A\u0C21\u0C02\u0C32\u0C4B\u0C28\u0C3F \u0C15\u0C4D\u0C32\u0C3F\u0C37\u0C4D\u0C1F \u0C2A\u0C30\u0C3F\u0C38\u0C4D\u0C25\u0C3F\u0C24\u0C41\u0C32\u0C15\u0C41 OLX \u0C12\u0C15 \u0C24\u0C47\u0C32\u0C3F\u0C15 \u0C2A\u0C30\u0C3F\u0C37\u0C4D\u0C15\u0C3E\u0C30\u0C3E\u0C28\u0C4D\u0C28\u0C3F \u0C05\u0C02\u0C26\u0C3F\u0C38\u0C4D\u0C24\u0C4B\u0C02\u0C26\u0C3F.<br /><br />OLX \u0C2E\u0C40\u0C26 \u0C2E\u0C40\u0C30\u0C41:<br /><ul><li>\u0C1A\u0C3F\u0C24\u0C4D\u0C30\u0C3E\u0C32\u0C24\u0C4B \u0C15\u0C42\u0C21\u0C3F\u0C28 \u0C2E\u0C02\u0C1A\u0C3F \u0C1A\u0C3F\u0C24\u0C4D\u0C30\u0C3E\u0C32\u0C28\u0C41 \u0C24\u0C47\u0C32\u0C3F\u0C15\u0C17\u0C3E \u0C30\u0C42\u0C2A\u0C4A\u0C02\u0C26\u0C3F\u0C02\u0C1A\u0C17\u0C32\u0C30\u0C41</li><li>\u0C28\u0C3E OLX \u0C32\u0C4B \u0C2E\u0C40 \u0C05\u0C2E\u0C4D\u0C2E\u0C15\u0C02, \u0C15\u0C4A\u0C28\u0C41\u0C17\u0C4B\u0C32\u0C41 \u0C07\u0C02\u0C15\u0C3E \u0C07\u0C24\u0C30\u0C41\u0C32\u0C24\u0C4B \u0C1A\u0C47\u0C38\u0C47 \u0C2A\u0C28\u0C41\u0C32\u0C28\u0C41 \u0C28\u0C3F\u0C2F\u0C02\u0C24\u0C4D\u0C30\u0C3F\u0C02\u0C1A\u0C02\u0C21\u0C3F</li><li>\u0C2E\u0C40 \u0C38\u0C4B\u0C37\u0C32\u0C4D \u0C28\u0C46\u0C1F\u0C4D \u0C35\u0C30\u0C4D\u0C15\u0C3F\u0C02\u0C17\u0C4D \u0C2A\u0C4D\u0C30\u0C4A\u0C2B\u0C48\u0C32\u0C4D (Facebook, \u0C2E\u0C48\u0C38\u0C4D\u0C2A\u0C47\u0C38\u0C4D, ....) \u0C32\u0C4B \u0C2E\u0C40 \u0C1C\u0C3E\u0C2C\u0C3F\u0C24\u0C3E\u0C32\u0C28\u0C41 \u0C2A\u0C4D\u0C30\u0C26\u0C30\u0C4D\u0C36\u0C3F\u0C02\u0C1A\u0C02\u0C21\u0C3F</li><li>\u0C08 \u0C38\u0C48\u0C1F\u0C4D \u0C28\u0C41 \u0C2E\u0C40 \u0C2E\u0C4A\u0C2C\u0C48\u0C32\u0C4D \u0C2B\u0C4B\u0C28\u0C41 \u0C28\u0C41\u0C02\u0C21\u0C3F \u0C09\u0C2A\u0C2F\u0C4B\u0C17\u0C3F\u0C02\u0C1A\u0C02\u0C21\u0C3F</li><li> OLX \u0C28\u0C3F \u0C2E\u0C40 \u0C2A\u0C4D\u0C30\u0C3E\u0C02\u0C24\u0C40\u0C2F \u0C2D\u0C3E\u0C37\u0C32\u0C4B \u0C35\u0C40\u0C15\u0C4D\u0C37\u0C3F\u0C02\u0C1A\u0C02\u0C21\u0C3F</li></ul><br />OLX, <<QTY_COUNTRIES>> \u0C2A\u0C48\u0C17\u0C3E \u0C26\u0C47\u0C36\u0C3E\u0C32\u0C32\u0C4B <<QTY_LANGUAGES>> \u0C2A\u0C48\u0C17\u0C3E \u0C2D\u0C3E\u0C37\u0C32\u0C32\u0C4B \u0C09\u0C2A\u0C2F\u0C4B\u0C17\u0C3F\u0C02\u0C1A\u0C2C\u0C21\u0C41\u0C24\u0C4B\u0C02\u0C26\u0C3F. \u0C08 \u0C15\u0C02\u0C2A\u0C46\u0C28\u0C40 \u0C2E\u0C3E\u0C30\u0C4D\u0C1A\u0C3F 2006\u0C32\u0C4B \u0C38\u0C4D\u0C25\u0C3E\u0C2A\u0C3F\u0C02\u0C1A\u0C2C\u0C21\u0C3F\u0C28, \u0C2A\u0C4D\u0C30\u0C48\u0C35\u0C47\u0C1F\u0C41 \u0C38\u0C02\u0C38\u0C4D\u0C25. </p>',
